import React from "react";
import axios from "axios";

import "./App.css";

class App extends React.Component {
  state = {
    Bible: "",
  };

  componentDidMount() {
    this.fetchBible();
  }

  fetchBible = () => {
    axios
      .get("https://api.scripture.api.bible/v1/swagger.json")
      .then((response) => {
        console.log(response.data.slip.bible);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  render() {
    return <h1>APP</h1>;
  }
}

export default App;
